Hi All;



 Well, I think it&#39;s close enough to call the predictions I was =
getting a
non event. Confusing this is, since I get trivial predictions tha=
t hit,
but this big stuff, not! At first it&#39;s tempting to throw the boxes a=
t
the wall and walk away from this stuff, but it&#39;s just too damn
intriguing=
 to give up, and besides to give lets this deceptive, or lying
element win.=
 I don&#39;t know what&#39;s going on, but I have to keep plugging
away at it, and =
as always not take it like it&#39;s written in stone. I did
have my doubts abou=
t these predictions, and that was probably my
intuition trying to get throu=
gh. 





 I keep my tape deck on the dresser, since I like to listen in =
the
bathroom, one of the few quiet rooms in the house, and even this mornin=
g
a little voice &quot;Frank, it&#39;s today&quot;, and I think &quot; but the day&#39;s about
ove=
r in England&quot;. I guess, there&#39;s a chance, but hopefully not!



 There was=
 some information in these voices that didn&#39;t add up. Like one
said we were=
 going through some of these rocks ( a meteor field) on
Sunday, but that ac=
tually happened on Saturday, I think, cuz one did hit
in Norway on the 10th=
, which I don&#39;t accept as a hit by the guys.
http://www.unknowncountry.com/=
news/?id=3D5347 



 Then the main voice I got that started all of this ac=
tually said the
&quot;16th&quot;, but I don&#39;t want to hold on to that saying &quot;wait fo=
r it&quot;, &quot;wait
for it&quot;, &quot;wait for it&quot;.........forever!



 This stuff is so =
confusing!



 Frank




